function parseMYSQLDumpFile($fileName)
{
    $queryCnt=0;
    $query = "";
    $fileContent=file($fileName);

    foreach($fileContent as $lineNum => $sqlLine)
    {
        $tsl = trim($sqlLine);

        if ((substr($tsl, 0, 2) != "--") && (substr($tsl, 0, 1) != "#"))
        {
            $query .= $sqlLine;
            if(preg_match("/;\s*$/", $sqlLine))
            {
                $result = MySQL::runCommand($query);
                if (is_numeric($result))
                    $queryCnt++;
                $query = "";
            }
        }
    }
    return $queryCnt;
}

